import React from 'react';
import 'karrotframe/lib/index.css';
import { Navigator, Screen } from 'karrotframe';

function App() {
  return (
    <div style={{ height: '100vh' }}>
      <Navigator
        theme="Cupertino"
        onClose={() => {
          console.log('닫기버튼이 눌렸습니다');
        }}
      >
        <Screen path="/"></Screen>
      </Navigator>
    </div>
  );
}

export default App;
